import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import '../css/OrderHistory.css';
import Navbar from '../components/Navbar';

const OrderHistory = () => {
    const [data, setData] = useState([]);
    const { id } = useParams();

    useEffect(() => {
        axios.get(`http://localhost:4000/orderhistory/${id}`)
            .then(response => {
                setData(response.data);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, [id]);

    return (
        <>
            <Navbar /><br/><br/>
            <div className="header-container">
                <h2>Order History</h2>
            </div>
            <div className="container">
                {data.map(order => (
                    <div key={order.BookingId} className="card">
                        <h3>Booking ID: {order.BookingId}</h3>
                        <p>Booking Start Date: {order.BookingStartDate}</p>
                        <p>Booking End Date: {order.BookingEndDate}</p>
                        <p>NetAmount: {order.NetAmount}</p>
                        <p>Tax: {order.Tax}</p>
                        <p>Discount: {order.Discount}</p>
                        <h4>Total Price: ${order.TotalPrice}</h4>
                        <button className="details-button">View Details</button>
                    </div>
                ))}
            </div>
        </>
    );
}

export default OrderHistory;
